import {fetchCryptoList} from '../../api'
import {useState,useEffect} from 'react'

const CryptoList = () => {

    const [cryptoList, setCryptoList] = useState(null)

    useEffect(() => {
       const getCryptoList = async() => {
            setCryptoList(await fetchCryptoList())
       }
    })
    return (
        <div>
            Crypto List
        </div>
    );
}

export default CryptoList;
